import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

function Cards(props){
    return (
            <Col>
                <Card>
                    <Card.Body>
                    <h3>{props.header}</h3>
                    <p>{props.para}</p>
                    </Card.Body>
                </Card>
            </Col>
    )
}

const Portfolio = () => {
    return (
        <div style={{paddingTop: "200pt", paddingBottom: "200pt"}}>
        <Container>
            <Row>
                <Cards header="Yo" para="fdfdsfdsfsfsdfsdfsf" />
                <Cards header="yoo" para="sdfdsfsfs" />
                <Cards />
            </Row>
        </Container>
        </div> 
     );
}

export default Portfolio;
